from django.shortcuts import render
import base64
import os
from google import genai
from google.genai import types
import markdown

# Create your views here.
def generate(question):
    client = genai.Client(
        api_key=os.environ.get("GEMINI_API_KEY"),
    )

    model = "gemini-2.5-flash"
    contents = [
        types.Content(
            role="user",
            parts=[
                types.Part.from_bytes(
                    mime_type="image/jpeg",
                    data=base64.b64decode(
                        """"""
                    ),
                ),
                types.Part.from_text(text="""you are personal assistant of \"Trividha\". An event conducted by students from the stream science,commerce and humanities
Trividha has three sub events:
Sthithapagya-conducted by science students
Optazia-conducted by commerce students
Xenora-conducted by humanities students
the  events under sthithapragya,optazia,xenora and common events:
        given in brochure attached, also rules for each event

you have to welcome user with greetings. and answer the question with relevant answer from this. Dont give your thought process in answer and try to avoid unnecessary things.if you are not sure about your answer say you are not sure, dont give false information. if an event is not mentioned as a team event then it is individual. if the users question is out of the topic. just answer question is not seem to be related to trividha.Ask anything else"""),
            ],
        ),
        types.Content(
            role="model",
            parts=[
                types.Part.from_text(text="""Hello! I'm here to assist you with information regarding the Trividha event.

How can I help you today? 
"""),
            ],
        ),
        types.Content(
            role="user",
            parts=[
                types.Part.from_text(text=question),
            ],
        ),
    ]
    generate_content_config = types.GenerateContentConfig(
    )

    for chunk in client.models.generate_content_stream(
        model=model,
        contents=contents,
        config=generate_content_config,
    ):
        response_text = ""
        for chunk in client.models.generate_content_stream(
            model=model,
            contents=contents,
            config=generate_content_config,
        ):
            response_text += chunk.text
    response_html = markdown.markdown(response_text,extensions=['nl2br', 'fenced_code'])
    return response_html




def chat(request):
    if request.POST:
        
        message=request.POST.get("question")
        answer=generate(message)
        return render(request,"chat.html",{"answer":answer})
    return render(request,"chat.html")









